import React from 'react';
import '../../assets/fonts/font.css'
import {
    Navbar,
    Container,
    Nav
 } from 'react-bootstrap';
 import './NavBar.css';
 import { BrowserRouter, Switch, Route, Link } from 'react-router-dom';
 import DialexaBVG from '../../assets/DialexaBVGMainLogo.png'
 import GameSelector from '../../views/HomePage/GameSelector.js';

class NavBar extends React.Component {
    render() {
        return (
            <BrowserRouter>
                <Switch>
                    <Route
                        exact
                        render={() => (
                            <Navbar className="nav" expand="lg" fixed="top">
                                <Container className="cont">
                                    <Navbar.Brand className="brand">
                                        <img className="logo" alt="DialexaBVG" src={DialexaBVG}></img>
                                    </Navbar.Brand>
                                    <Nav class="row justify-content-center align-self-center">
                                        <Link className="link"to="/game">Play</Link>
                                        <Nav.Link className="disabled">Leaderboard</Nav.Link>
                                        <Nav.Link className="disabled">Explore</Nav.Link>
                                        <Nav.Link className="disabled">About</Nav.Link>
                                    </Nav>
                                    <div className="nameBox">
                                        <Nav.Link className="name">
                                            Welcome Back, John!
                                        </Nav.Link>
                                    </div>
                                </Container>
                            </Navbar>
                        )}
                    />
                    <Route
                        path="/game"
                        exact
                        render={() => (
                            <GameSelector />
                        )}
                    />
                </Switch>
            </BrowserRouter>
        );
    }
}

export default NavBar;
